import React from 'react';
import Navbarcomponent from '../navbar';

const AdminNavbar = () => {
  return (
    <div className="container-fluid px-0" > 
    <Navbarcomponent />
      <nav className="navbar navbar-expand-lg navbar-dark bg-black py-4 px-0">
        <a className="navbar-brand" href="#">
        &nbsp;&nbsp;&nbsp;<strong style={{ fontSize: '36px' }}><i>INFOLIBRA</i></strong>
        </a>
        <button className="navbar-toggler mr-3" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
  <ul className="navbar-nav ml-auto">
  <li className="nav-item active">
      <a className="nav-link" style={{ fontSize: '24px' }} href="#">Dashboard</a>
    </li>&nbsp;&nbsp;
    <li className="nav-item">
      <a className="nav-link" style={{ fontSize: '24px' }} href="#">Add Book</a>
    </li>&nbsp;&nbsp;
    <li className="nav-item">
      <a className="nav-link" style={{ fontSize: '24px' }} href="#">Update</a>
    </li>&nbsp;&nbsp;
    <li className="nav-item">
      <a className="nav-link" style={{ fontSize: '24px' }} href="#">Delete</a>
    </li>&nbsp;&nbsp;
    <li className="nav-item">
      <a className="nav-link" style={{ fontSize: '24px' }} href="#">Status</a>
    </li>&nbsp;&nbsp;
    <li className="nav-item">
      <a className="nav-link" style={{ fontSize: '24px' }} href="#">About</a>
    </li>
    
  </ul>
</div>

        <button className="btn btn-danger" style={{ fontSize: '30px' }}>Logout</button>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      </nav>
    </div>
  );
};

export default AdminNavbar;
